import React, { ReactElement } from 'react';
import { RouteComponentProps } from '@reach/router';

import { Layout } from '@/components/layouts';
import { Head } from '@/components/common';
import courses from '@/mock-files/courses.json';

interface IProps extends RouteComponentProps {
  courseId?: string;
}

function CoursePage(props: IProps): ReactElement {
  return (
    <Layout isHeaderOpaque>
      <Head
        title={`Course ${props.courseId}`}
        description={`Details about course ${props.courseId}`}
      />
      <main>
        <section className="course-page__content">
          {props.courseId}
        </section>
      </main>
    </Layout>
  );
}

export default CoursePage;
